import {useState} from 'react';

function Home(){
    return <Contador />
}

function Contador(){
    const [contador, setContador] = useState(1);

    return 
        <div>
            <div>{contador}</div>
            <button onClick={setContador(contador+1)}>Contar!</button>
        </div>
}

export default Home
